import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './Components/Header';
import Sidebar from './Components/Sidebar';
import Students from './Components/Students';
import Application from './Components/Application';
import Employee from './Components/Employee';
import Fleet from './Components/Fleet';
import Warehouse from './Components/Warehouse';
import SMS from './Components/SMS';
import QuestionBank from './Components/QuestionBank';
import AssetsManagement from './Components/AssetsManagement';
import PaymentServices from './Components/PaymentServices';
import CCTV from './Components/CCTV';
import HRMS from './Components/HRMS';

function App() {
  return (
    <Router>
      <div className="d-flex flex-column vh-100">
        {/* Header */}
        <header className="header">
          <Header />
        </header>

        {/* Body */}
        <div className="d-flex flex-grow-1">
          {/* Left Sidebar */}
          <aside className="sidebar">
            <Sidebar />
          </aside>

          {/* Main content */}
          <main className="main-content flex-grow-1 p-2" style={{background: '#F6F8F9'}}>
            <Routes>
              <Route path="/students" element={<Students />} />
              <Route path="/application" element={<Application />} />
              <Route path="/employee" element={<Employee />} />
              <Route path="/fleet" element={<Fleet />} />
              <Route path="/warehouse" element={<Warehouse />} />
              <Route path="/sms" element={<SMS />} />
              <Route path="/question-bank" element={<QuestionBank />} />
              <Route path="/assets-management" element={<AssetsManagement />} />
              <Route path="/payment-services" element={<PaymentServices />} />
              <Route path="/cctv" element={<CCTV />} />
              <Route path="/hrms" element={<HRMS />} />
              <Route path="/" element={<Students />} /> {/* Default route */}
            </Routes>
          </main>
        </div>
      </div>
    </Router>
  );
}

export default App;
